import matplotlib.pyplot as plt

def show_curve(x,loss,psnr,ssim,title):
  plt.figure()
  plt.subplot(1,3,1)
  plt.plot(x,loss)
  plt.xlabel("LOSS")
  plt.subplot(1,3,2)
  plt.plot(x,psnr)
  plt.xlabel("PSNR")
  plt.subplot(1,3,3)
  plt.plot(x,ssim)
  plt.xlabel("SSIM")
  plt.suptitle(title)

  plt.show()


